    const allFields = form.find("input[type=text], input[type=checkbox], input[type=number], textarea, select");
    const radioFields = form.find("input[type=radio]");
    const hiddenInputs = form.find("input[type=hidden]");
    const overlay = form.parent().find(".c-form--overlay");

    const endpointUrl = form.parent().data("endpoint");
    const formId = hiddenInputs[0].value + "_v" + hiddenInputs[4].value;
    const tenant = hiddenInputs[1].value;
    const site = hiddenInputs[2].value;
    const instance = hiddenInputs[3].value;

    const instanceIsLocalhost = instance === "localhost";

    const captchaTextfieldParent = form.find(".captcha-textfield-parent");
    const captchaImageParent = form.find(".captcha-img-parent");
    const captchaTimerText = form.find(".captcha-timer__text");
    
