      // disable HTML form elements to prevent selection and focus
      htmlFormElementsToDisable.each(function () {
        this.disabled = isDisabled;
      });
      // disable elements which trigger disabled styling for an entire component
      parentElementsToDisable.attr("disabled", isDisabled);

