      var data = overlayContainer.data();
      var teaserOpacityValue = (data.overlayType === "gradient" ? data.gradientOpacity : data.fullOpacity) / 100;
      var teaserStartColor = "rgba(" + (data.overlayStyle === "dark" ? "0,0,0," : "255,255,255,") + teaserOpacityValue + ")";
