(function($) {

  var COOKIE_NAME = "salesrep-agent";
  var COOKIE_LIFETIME_DAYS = 182;

  var isSetCookieAllowed = function() {
    return ((!gdprEnabled || gdprEnabled && omcore_gdpr_consent_anyactive) ? true : false);
  };

  var setSalesRepCookie = function(agencyId, childAgencyId, agentId) {
    if (isSetCookieAllowed()) {
      var cookieJson;
      if (childAgencyId == null) {
        cookieJson = {
          agencyId: agencyId,
          agentId: agentId
          };
      } else {
        cookieJson = {
          agencyId: agencyId,
          childAgencyId: childAgencyId,
          agentId: agentId
        };
      }
      Cookies.set(COOKIE_NAME, JSON.stringify(cookieJson), { expires : COOKIE_LIFETIME_DAYS });
    }
  };

  var getSalesRepCookie = function() {
    var cookie = Cookies.get(COOKIE_NAME);
    return ((typeof cookie === 'undefined') ? null : cookie);
  };

  $(document).ready(function() {
    if ($('.js-salesrep-agency-agent').length > 0) {

      if (isSetCookieAllowed()) {
        $('.js-salesrep-agency-agent').SalesRepCookie();
      } else {
        setupOptanon();
      }
    }
  });

  var initMyAgentRadios = function(myAgentRadios) {
    var cookieString = getSalesRepCookie();
    if (cookieString !== null) {
      var cookieJson = JSON.parse(cookieString);
      var agencyId = cookieJson.agencyId.toString();
      var agentId = cookieJson.agentId.toString();

      for (let i = 0; i < myAgentRadios.length; i++) {
        var radio = myAgentRadios[i];
        if (agentId === radio.getAttribute("id") && agencyId === radio.getAttribute('data-agency-id')) {
          radio.checked = true;
        }
        radio.parentNode.style.visibility = radio.hasAttribute('data-is-consultant') ? 'visible' : 'hidden';
      }
    }
  };

  function updatePreferredAgentInHeader(agencyId, childAgencyId, agentId) {
    window.setPreferredAgent(agencyId, childAgencyId, agentId);
  }

  function setupOptanon() {
    if (typeof Optanon !== "undefined" && typeof Optanon.OnConsentChanged !== "undefined") {
      Optanon.OnConsentChanged(function() {
        if (Optanon.IsAlertBoxClosed() && isSetCookieAllowed()) {
          $('.js-salesrep-agency-agent').SalesRepCookie();
        }
      });
    }
  }

  $.fn.SalesRepCookie = function() {
    if (getSalesRepCookie() === null) {
      var currentAgencyId = $(this).data('salesrep-agency-id');
      var firstAgentId = $(this).data('salesrep-agent-id');

      if (currentAgencyId !== undefined && firstAgentId !== undefined) {
        setSalesRepCookie(currentAgencyId, null, firstAgentId);
        updatePreferredAgentInHeader(currentAgencyId, null, firstAgentId);
      }
    }

    var myAgentRadios = $(".js-salesrep-agent-select");

    if (myAgentRadios.length) {
      myAgentRadios.off("click").on("click", function() {
        var agencyId = $(this).data('agency-id');
        var childAgencyId = $(this).data('child-agency-id') == null ? null : $(this).data('child-agency-id');
        var agentId = this.attributes['id'].value;

        setSalesRepCookie(agencyId, childAgencyId, agentId);
        updatePreferredAgentInHeader(agencyId, childAgencyId, agentId);
      });

      initMyAgentRadios(myAgentRadios);
    }
  };
})($);

