$.fn.iframePassParameters = function () {
    return this.each(function () {
        const $iframe = $(this);
        var ATTR_PARAMS = 'data-pass-parameters-list',
            allowedParamArray = $iframe.attr(ATTR_PARAMS) === undefined ? [] : $iframe.attr(ATTR_PARAMS).split(','),
            paramArray = location.search.length < 2 ? [] : location.search.substr(1).split('&'),
            appendPassParameters = [];

        for (var i = 0; i < paramArray.length; i++) {
            for (var ii = 0; ii < allowedParamArray.length; ii++) {
                if (paramArray[i].indexOf(allowedParamArray[ii] + '=') > -1) {
                    appendPassParameters.push(paramArray[i]);
                }
            }
        }
        $iframe.attr('src', $iframe.attr('src') + '&' + appendPassParameters);
    });
};

$(document).ready(function() {
    $('iframe[data-pass-parameters]').iframePassParameters();
});

