(function($) {
    "use strict";

     function getJSONForContainers(){
            var jsonContainer = {};
            var arr = null;
            var iframeDoc = null;

            if($('iframe').length>0){
                iframeDoc = $($('iframe').contents()[0]);
                arr = iframeDoc.find(".agent-card-container");
            }
            else{
                arr = $(".agent-card-container");
            }

            if(arr != null)
            {
                var arrChildren = $(arr).find("div[id*='agent_card_container']");

                arrChildren.each(function(){
                    var eleId = $(this).attr("id");
                    if($('iframe').length>0){
                        var countChildrenCardsEditM = $(this).find("div.agent-card").length;
                        var countChildrenXFEditM = $(this).find("div.agent-card-xf").length;
                        jsonContainer[eleId] = countChildrenCardsEditM + countChildrenXFEditM;
                    }
                    else{
                        var countChildrenCards = $(this).find("div.c-agent-card-tile__container").length;
                        jsonContainer[eleId] = countChildrenCards;
                    }
                });
            }
            return jsonContainer;
        }


    $(document).ready(function() {
        var jsonValue = getJSONForContainers();
        if(!$.isEmptyObject(jsonValue)){
            $.each(jsonValue, function(key, value) {
              if(value>=9){

                  var arrSplit = key.split("/");
                  var lastwordSplit = arrSplit[arrSplit.length - 1];
                  var firstwordSplit = arrSplit[arrSplit.length - 2];
                  var newId = firstwordSplit+"\\/"+lastwordSplit;

                  var item = $("div#"+newId+" div[class*=js-carousel-agent-card-tile]");

                  item.removeClass("js-carousel-agent-card-tile--grid");
                  item.addClass("js-carousel-agent-card-tile");
                  item.attr("data-swiper-desktop-display","carousel");
                  item.agentCardTileCarousel();
              }
            });
        }
    });

})($);

